import { Link } from "react-router-dom";
import "./ConfirmButton.scss";

export const ConfirmButton = ({ children, onClick, goTo }) => {
  return (
    <button className="confirmButton" onClick={() => onClick()} disabled>
      <Link to={goTo} className="linkBtn">{children}</Link>
    </button>
  );
};
